import React from "react";
import styled from "styled-components";
import blueTriangle from "../misc/images/tr_3.png"
import {PageWrapper} from "../components/PageWrapper";
import {StyledTriangle} from "../components/Triangles"
import {TextRectangle} from "../components/TextRectangle";

const AboutMePageWrapper = styled(PageWrapper)`
  display: flex;
  flex-flow: column;
`;

const RotatedTriangleImg = styled(StyledTriangle)`
  transform: rotate(180deg);
  z-index: 1;
`;

const AboutMeWrapper = styled.section`
  font-size: 5vw;
  align-self: flex-end;
  margin-right: 25vw;
`;

const Grey = styled(TextRectangle)`
&::before {
background-color: black;
}
`;


function AboutMePage() {
    return(
        <AboutMePageWrapper>
            <RotatedTriangleImg as="img" src={blueTriangle} alt="blue" />
            <AboutMeWrapper>
                <TextRectangle>Something about me</TextRectangle>
            </AboutMeWrapper>
        </AboutMePageWrapper>
    )
}

export {AboutMePage};
